apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  name: keycloakoperator.1.9.5
  namespace: placeholder
  annotations:
    certified: 'false'
    support: 'Red Hat, Inc.'
    containerImage: 'quay.io/integreatly/keycloak-operator:v1.9.5'
    createdAt: '2019-05-02 11:45:00'
    alm-examples: >-
      []
    capabilities: Full Lifecycle
    categories: Single Sign-On
    description: >-
      Red Hat Single Sign-On provides Web single sign-on and identity federation based on SAML 2.0, OpenID Connect and OAuth 2.0 specifications.
spec:
  displayName: Red Hat Single Sign-On
  description: Red Hat Single Sign-On provides Web single sign-on and identity federation based on SAML 2.0, OpenID Connect and OAuth 2.0 specifications.
  keywords: ['RHSSO', 'keycloak', 'aerogear']
  version: 1.9.5
  maturity: alpha
  minKubeVersion: 1.11.0
  maintainers:
    - name: aerogear
      email: aerogear@googlegroups.com
  provider:
    name: Aerogear
  labels:
    alm-owner-keycloak: keycloakoperator
    app: keycloak-operator
  selector:
    matchLabels:
      alm-owner-keycloak: keycloak-operator
      app: keycloak-operator
  icon:
    - base64data: .8.
      mediatype: image/png
  installModes:
    - supported: true
      type: OwnNamespace
    - supported: true
      type: SingleNamespace
    - supported: true
      type: MultiNamespace
    - supported: true
      type: AllNamespaces
  customresourcedefinitions:
    owned:
      - name: keycloaks.aerogear.org
        version: v1alpha1
        kind: Keycloak
        displayName: Keycloak
        description: Represents an Keycloak Identity and Access Management solution.
        specDescriptors:
          - description: The version of Keycloak
            displayName: Version
            path: version
          - description: Admin Credentials
            displayName: Admin Credentials
            path: adminCredentials
          - description: Plugin names
            displayName: Plugin names
            path: plugins
          - description: Backup configuration
            displayName: Backups
            path: backups
          - description: Provision
            displayName: Provision
            path: provision
      - name: keycloakrealms.aerogear.org
        version: v1alpha1
        kind: KeycloakRealm
        displayName: Keycloak Realm
        description: Represents an Keycloak realm. A realm manages a set of users, credentials, roles, and groups. A user belongs to and logs into a realm. Realms are isolated from one another and can only manage and authenticate the users that they control. and Access Management solution.
        specDescriptors:
          - description: The Id
            displayName: Id
            path: id
          - description: The Realm
            displayName: Realm
            path: realm
          - description: Enabled
            displayName: Enabled
            path: enabled
          - description: Display Name
            displayName: Display Name
            path: displayName
          - description: Provision
            displayName: Provision
            path: provision
          - description: Create Only
            displayName: Create Only
            path: createOnly
          - description: An identity provider (IDP) is a service that can authenticate a user. Keycloak is an IDP.
            displayName: Identity Providers
            path: identityProviders
          - description: Users are entities that are able to log into your system. They can have attributes associated with themselves like email, username, address, phone number, and birth day.
            displayName: Users
            path: users
          - description: Clients are entities that can request Keycloak to authenticate a user. Most often, clients are applications and services that want to use Keycloak to secure themselves and provide a single sign-on solution
            displayName: Clients
            path: clients
  install:
    strategy: deployment
    spec:
      permissions:
        - serviceAccountName: keycloak-operator
          rules:
            - apiGroups:
                - batch
              resources:
                - "cronjobs"
              verbs:
                - "*"
            - apiGroups:
                - aerogear.org
              resources:
                - "*"
              verbs:
                - "*"
            - apiGroups:
                - ""
              resources:
                - persistentvolumeclaims
                - events
                - secrets
                - services
                - pods
              verbs:
                - "*"
            - apiGroups:
                - "template.openshift.io"
              resources:
                - processedtemplates
              verbs: [ get, list, create, update, delete, deletecollection, watch]
            - apiGroups:
                - apps.openshift.io
              resources:
                - deploymentconfigs
              verbs: [ get, list, create, update, delete, deletecollection, watch]
            - apiGroups:
                - route.openshift.io
              resources:
                - routes
                - routes/custom-host
              verbs: [ get, list, create, update, delete, deletecollection, watch]
            - apiGroups:
                - integreatly.org
              resources:
                - grafanadashboards
              verbs:
                - '*'
            - apiGroups:
                - monitoring.coreos.com
              resources:
                - prometheusrules
                - servicemonitors
              verbs:
                - '*'
      deployments:
        - name: keycloak-operator
          spec:
            replicas: 1
            selector:
              matchLabels:
                alm-owner-keycloak: keycloak-operator
                app: keycloak-operator
            template:
              metadata:
                labels:
                  alm-owner-keycloak: keycloak-operator
                  app: keycloak-operator
              spec:
                serviceAccountName: keycloak-operator
                containers:
                  - name: keycloak-operator
                    image: quay.io/integreatly/keycloak-operator:v1.9.5
                    ports:
                      - containerPort: 60000
                        name: metrics
                    command:
                      - keycloak-operator
                    imagePullPolicy: Always
                    env:
                      - name: WATCH_NAMESPACE
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.namespace
                      - name: OPERATOR_NAME
                        value: "keycloak-operator"
                      - name: CONSUMER_NAMESPACES
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.namespace
